  return (
    <BrowserRouter>
      <div>
        <ul>
          <li>
            <Link to="/recentlyplayed">RecentlyPlayed</Link>
          </li>
          <li>
            <Link to="/logout">Logout</Link>
          </li>
        </ul>
        <Switch>
          <Route path="/recentlyplayed">
            <RecentTracks />
